export default function Post() {
  CheckLogin();

  const logout = () => {
    localStorage.removeItem('tokenEddit');
  }

  return (
    <div>
      <h1>Sou a Home</h1>
      <button onClick={logout}>Sair da conta</button>
    </div>
  );
}
